     <p className='para'>MORE TARGETED WAYS TO PROTECT CROPS WITH LESS INPUT</p>
     <p className='para1'>Innovation in the agriculture sector and precision farming will result in the need for fewer inputs. Find out how we are working every day to deliver more targeted ways to protect crops, with less inputs.</p>
     <h5 className="b_text"><button className='bu' type="submit" >MONITORING SERVICES</button></h5>
    </div>
  )
}

export default Main
